var formatURL = function(url){
    return url.replace(/[\r\n\s]*/g,"");
};

module.exports = function(vastArr){

    if(!vastArr || vastArr.length === 0){
        return {error:"empty"};
    }

    if(vastArr[0].error){
        return {error:vastArr[0].error};
    }

    var ret = {
        impressions : [],
        tracking : {}
    };

    vastArr.forEach(function(v){

        var type = v.DAAST ? "DAAST" : "VAST";
        if(v[type].Ad[0].InLine[0].Impression){
            v[type].Ad[0].InLine[0].Impression.forEach(function(impURL){
                ret.impressions.push(formatURL(impURL._ || impURL));
            });
        }

        var trackingEvents = v[type].Ad[0].InLine[0].Creatives[0].Creative[0].Linear[0].TrackingEvents;
        if(trackingEvents && trackingEvents[0].Tracking){
            trackingEvents[0].Tracking.forEach(function(t){
                
                var url         = formatURL(t._),
                    eventType   = t.$.event;

                if(!ret.tracking[eventType]) ret.tracking[eventType] = [];

                ret.tracking[eventType].push(url);
            });
        }
   
    });

    var last            = vastArr.slice(-1)[0],
        type            = last.DAAST ? "DAAST" : "VAST",
        creatives       = last[type].Ad[0].InLine[0].Creatives[0].Creative,
        linear          = creatives
                            .filter(function(c){
                                return c.Linear;
                            })
                            .map(function(c){
                                return c.Linear[0];
                            })[0],
        media           = creatives
                            .filter(function(c){
                                return c.Linear;
                            })
                            .map(function(c){
                                return c.Linear[0].MediaFiles[0].MediaFile[0];
                            })[0],
        companions      = creatives
                            .filter(function(c){
                               return c.CompanionAds;
                            })
                            .map(function(c){
                                return c.CompanionAds[0].Companion[0];
                            });

    if(companions.length > 0){

        companions.forEach(function(comp){
            if(comp.TrackingEvents){
                comp.TrackingEvents[0].Tracking.forEach(function(t){
                    var url         = formatURL(t._),
                        eventType   = t.$.event;

                    if(!ret.tracking[eventType]) ret.tracking[eventType] = [];
                    ret.tracking[eventType].push(url);

                });
            }

        });

         ret.poster = companions
            .filter(function(comp){
                return comp.StaticResource && comp.StaticResource[0].$.creativeType.indexOf("image") === 0;
            })
            .map(function(comp){
                return {
                    url : formatURL(comp.StaticResource[0]._),
                    width : comp.$.width,
                    height : comp.$.height
                };
            })[0];
    }                        

    ret.mime        = media.$.type;
    ret.src         = formatURL(media._);

    ret.clickURL = "#";
    if(linear.VideoClicks){
        linear.VideoClicks.forEach(function(vc){
            if(vc.ClickThrough){
                ret.clickURL    = formatURL(vc.ClickThrough[0]._ || vc.ClickThrough[0]);
            }

            if(vc.CustomClick){
                ret.clickURL    = formatURL(vc.CustomClick[0]._ || vc.CustomClick[0]);
            }
        });
    }
    ret.width       =  "100%";//media.$.width+"px";
    ret.height      = "100%";//media.$.height+"px";

    if(ret.poster && ret.mime.indexOf("audio")===0 ){
        ret.width   = ret.poster.width+"px";
        ret.height  = ret.poster.height+"px";
    }

    return ret;

};

